import React from 'react';
import './About.css';


function About() {
  return (
    <div className='About'>
     <div>
      <button>About Bernard</button>
      <button>Experience</button>
      <button>Freelance</button>
      <button>Coding</button>
      <button>Contact</button>
     </div>

     <div>
       <h2>Experience</h2>
       <ul>
        <li>News editor, <a href='https://dailybruin.com'>Daily Bruin &#10063;</a></li>
        <li>Contributor, <a href='https://calmatters.org'>CalMatters &#10063;</a></li>
        <li>Data Journalist, <a href='https://stack.dailybruin.com'>The Stack</a></li>
        <li>Staff reporter, <a href='https://dailybruin.com'>Daily Bruin &#10063;</a></li>
       </ul>
     </div>
    </div>
  );
}

export default About;
